css:
.fb-tasks-datatip {
  font-family: sans-serif;
  max-width: 30em;
  overflow: hidden;
  padding: 4px 8px;
}
.fb-tasks-title {
  color: #d9dbde;
  font-size: 1.2em;
  font-weight: bold;
  margin: 4px 0;
}
.fb-tasks-title,
.fb-tasks-owner {
  overflow: hidden;
  text-overflow: ellipsis;
}
.fb-tasks-number {
  margin: 0 4px;
}
.fb-tasks-task-priority {
  background-color: #D41D1D;
  display: inline-block;
  border-radius: 2px;
  padding: 0 4px;
  color: white;
  font-weight: bold;
}
.fb-tasks-task-priority-unbreak_now {
  background-color: #8036cc;
}
.fb-tasks-task-priority-high {
  background-color: #f23232;
}
.fb-tasks-task-priority-mid {
  background-color: #f88639;
}
.fb-tasks-task-priority-low {
  background-color: #eec954;
}
.fb-tasks-task-priority-wishlist {
  background-color: #5cc9b4;
}
.fb-tasks-task-priority-unknown {
  background-color: transparent;
  box-shadow: none;
  color: #898f9d;
}
.fb-tasks-status-line-closed {
  text-decoration: line-through;
}
.fb-tasks-owner-full-name {
  color: #a3a8ae;
  font-weight: bold;
}
.fb-tasks-tags {
  margin: 4px 0;
  white-space: normal;
}
.fb-tasks-tag {
  background-color: #27292c;
  color: #d9dbde;
  border-radius: 2px;
  display: inline-block;
  margin-bottom: 3px;
  margin-right: 3px;
  padding: 0 4px;
}
.fb-tasks-completion-status {
  font-weight: bold;
}
